// function to communicate with google vision api
async function requestVisionAPI(base64String) {
    // request 
    const request = {
        requests: [
            {
                image: {
                    content: base64String,
                },
                features: [
                    { maxResults: 5, type: "LABEL_DETECTION" },
                    { maxResults: 1, model: "builtin/latest", type: "OBJECT_LOCALIZATION" },
                    { maxResults: 10, model: "builtin/latest", type: "LOGO_DETECTION" },
                    { maxResults: 50, model: "builtin/latest", type: "DOCUMENT_TEXT_DETECTION" },
                ],
            }
        ]
    };

    return await fetch("https://vision.googleapis.com/v1/images:annotate?key=AIzaSyAf8GVkVGXaW6O4uFhzL7ppcY0poQeKHAw", {
        method: 'POST',
        headers: {
            'Content-Type': 'application/json',
        },
        body: JSON.stringify(request),
    })
        .then(response => response.json())
        .then(data => {
            return (JSON.stringify(data));
        })
        .catch(error => {
            return (JSON.stringify(error));
        })
}

